<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <style>
    :root {
      --cube-size: 260px;
      --cube-bg-color: #ffffff; --cube-panel-color: #ffffff; --cube-shadow-strength: 0.15; --cube-title-color: cornflowerblue; --cube-axis-color: firebrick; --cube-legend-color: limegreen; --cube-title-font-size: 20px; --cube-axis-font-size: 12.0px; --cube-legend-font-size: 12.0px; --cube-font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
    }
    * { box-sizing: border-box; }
    body {
      margin: 0;
      padding: 28px 14px 32px 14px;
      width: 100%;
      height: 100%;
      background: var(--cube-bg-color);
      color: var(--cube-axis-color);
      font-family: var(--cube-font-family);
      display: flex;
      align-items: flex-start;
      justify-content: center;
      overflow: hidden;
      user-select: none;
    }
    .cube-figure {
      width: min(1180px, 100%);
      display: flex;
      flex-direction: column;
      align-items: center;
      gap: 12px;
    }
    .cube-title {
      font-size: var(--cube-title-font-size);
      letter-spacing: 0.04em;
      font-weight: 700;
      text-align: center;
      color: var(--cube-title-color);
      margin-bottom: 4px;
    }
    .cube-main {
      width: 100%;
      display: flex;
      justify-content: center;
    }
    .cube-js-warning {
      width: min(1180px, 100%);
      display: flex;
      align-items: center;
      gap: 10px;
      margin: 6px auto 0 auto;
      padding: 10px 12px;
      background: #fff4d4;
      color: #5c4300;
      border: 1px solid #f2d27c;
      border-radius: 10px;
      font-size: var(--cube-axis-font-size, 13px);
      box-shadow: 0 8px 24px rgba(0,0,0,0.06);
    }
    .cube-js-warning.hidden {
      display: none;
    }
    .cube-js-warning .dot {
      width: 10px;
      height: 10px;
      border-radius: 999px;
      background: #f59e0b;
      box-shadow: 0 0 0 4px rgba(245,158,11,0.2);
    }
    .cube-inner {
      display: flex;
      flex-direction: column;
      align-items: center;
      gap: 10px;
    }
    .cube-container {
      position: relative;
      width: var(--cube-size);
      height: var(--cube-size);
      margin: auto;
    }

    .cube-wrapper {
      position: relative;
      inset: 0;
      width: 100%;
      height: 100%;
      perspective: 950px;
      transform-style: preserve-3d;
      touch-action: none;
      z-index: 0;
      --rot-x: 0rad;
      --rot-y: 0rad;
      --zoom: 1;
    }

    .cube-canvas {
      position: absolute;
      inset: 0;
      width: 100%;
      height: 100%;
      display: block;
      pointer-events: none;
    }

    .cube-rotation {
      position: absolute;
      inset: 0;
      transform-style: preserve-3d;
      transform:
        rotateX(var(--rot-x, 0rad))
        rotateY(var(--rot-y, 0rad))
        scale(calc(1 / var(--zoom, 1)));
    }

    .cube-drag-surface {
      position: absolute;
      inset: 0;
      z-index: 999;
      cursor: grab;
      background: transparent;
      touch-action: none;
      pointer-events: auto;
    }

    .cube-drag-surface.debug-show {
      background: rgba(0, 255, 0, 0.1);
    }

    .cube-scene {
      position: relative;
      inset: 0;
      perspective: 950px;
      transform-style: preserve-3d;
      --rot-x: 0rad;
      --rot-y: 0rad;
      --zoom: 1;
    }

    .cube-scene .cube-rotation {
      transform:
        rotateX(var(--rot-x, 0rad))
        rotateY(var(--rot-y, 0rad))
        scale(calc(1 / var(--zoom, 1)));
    }

    .scene-drag-surface {
      position: absolute;
      inset: 0;
      z-index: 999;
      cursor: grab;
      background: transparent;
      touch-action: none;
      pointer-events: auto;
    }

    .cd-cube {
      position: absolute;
      inset: 0;
      transform-style: preserve-3d;
      width: 100%;
      height: 100%;
      transform: translateZ(calc(var(--cube-size) / -2));
      pointer-events: none;
    }

    .cd-face {
      position: absolute;
      width: 100%;
      height: 100%;
      background-size: cover;
      background-position: center;
      background-repeat: no-repeat;
      backface-visibility: hidden;
      border: 1px solid rgba(0,0,0,0.08);
      filter: drop-shadow(0 2px 6px rgba(0,0,0,0.25));
      pointer-events: none;
    }

    .cd-front { transform: translateZ(calc(var(--cube-size) / 2)); }
    .cd-back { transform: rotateY(180deg) translateZ(calc(var(--cube-size) / 2)); }
    .cd-right { transform: rotateY(90deg) translateZ(calc(var(--cube-size) / 2)); }
    .cd-left { transform: rotateY(-90deg) translateZ(calc(var(--cube-size) / 2)); }
    .cd-top { transform: rotateX(90deg) translateZ(calc(var(--cube-size) / 2)); }
    .cd-bottom { transform: rotateX(-90deg) translateZ(calc(var(--cube-size) / 2)); }

    .interior-plane {
      position: absolute;
      inset: 0;
      width: 100%;
      height: 100%;
      background-size: cover;
      background-position: center;
      opacity: 0.65;
      mix-blend-mode: normal;
      border: 1px solid rgba(255,255,255,0.08);
      pointer-events: none;
      transform-style: preserve-3d;
    }

    .cd-vase-panel {
      position: absolute;
      transform-style: preserve-3d;
      backface-visibility: hidden;
      border-radius: 999px;
      opacity: 0.9;
      background: rgba(200, 60, 60, 0.9);
      box-shadow: 0 0 8px rgba(0, 0, 0, var(--cube-shadow-strength, 0.25));
      pointer-events: none;
    }

    .axis-label {
      position: absolute;
      font-size: var(--cube-axis-font-size, 13px);
      color: var(--cube-axis-color);
      pointer-events: none;
    }

    .cube-label {
      position: absolute;
      font-size: var(--cube-axis-font-size, 13px);
      color: var(--cube-axis-color);
      pointer-events: none;
      letter-spacing: 0.04em;
    }

    /* Tight to each cube face */
    .axis-x-min {
      bottom: 5%;
      left: 15%;
    }
    .axis-x-max {
      bottom: 5%;
      right: 15%;
    }
    .axis-x-name {
      bottom: 0%;
      left: 50%;
      transform: translateX(-50%);
    }

    .axis-y-min {
      top: 15%;
      right: 5%;
      transform: rotate(90deg);
    }
    .axis-y-max {
      bottom: 15%;
      right: 5%;
      transform: rotate(90deg);
    }
    .axis-y-name {
      top: 50%;
      right: 0%;
      transform: translateY(-50%) rotate(90deg);
    }

    .axis-t-min {
      left: 5%;
      top: 75%;
      transform: rotate(-90deg);
    }
    .axis-t-max {
      left: 5%;
      top: 25%;
      transform: rotate(-90deg);
    }
    .axis-t-name {
      left: 0%;
      top: 50%;
      transform: translateY(-50%) rotate(-90deg);
    }
    .cube-legend-panel {
      width: 100%;
      display: flex;
      justify-content: center;
      margin-top: 6px;
    }
    .cube-legend-card {
      background: #ffffff;
      padding: 8px 12px;
      border-radius: 10px;
      box-shadow: 0 8px 24px rgba(0,0,0,0.08);
      min-width: min(420px, 90%);
    }
    .colorbar-wrapper {
      width: 100%;
    }
    .colorbar-title {
      font-size: var(--cube-legend-font-size);
      font-weight: 600;
      color: var(--cube-legend-color);
      text-align: center;
      margin-bottom: 6px;
      font-family: var(--cube-font-family);
    }
    .colorbar-img {
      width: 100%;
      height: 14px;
      border-radius: 4px;
      border: 1px solid rgba(0,0,0,0.2);
      display: block;
    }
    .colorbar-labels {
      width: 100%;
      display: flex;
      justify-content: space-between;
      font-size: var(--cube-legend-font-size);
      margin-top: 6px;
      align-self: center;
      color: var(--cube-legend-color);
      gap: 6px;
    }
    .cb-tick {
      flex: 1;
      text-align: center;
    }
  </style>
</head>

          if (dragSurface && activePointerId !== null && dragSurface.hasPointerCapture(activePointerId)) {
            dragSurface.releasePointerCapture(activePointerId);
          }
          if (dragSurface) {
            dragSurface.style.cursor = "grab";
          }
          activePointerId = null;
        }

        if (dragSurface) {
          dragSurface.style.cursor = "grab";
          dragSurface.style.touchAction = "none";

          dragSurface.addEventListener("pointerdown", e => {
            e.preventDefault();
            e.stopPropagation();
            dragging = true;
            activePointerId = e.pointerId;
            startX = e.clientX;
            startY = e.clientY;
            startRotX = rotationX;
            startRotY = rotationY;
            dragSurface.setPointerCapture(e.pointerId);
            dragSurface.style.cursor = "grabbing";
            window.addEventListener("pointermove", handlePointerMove);
          });

          dragSurface.addEventListener("pointerup", endEvent => {
            stopDragging(endEvent);
          });

          dragSurface.addEventListener("pointercancel", endEvent => {
            stopDragging(endEvent);
          });

          dragSurface.addEventListener("wheel", e => {
            e.preventDefault();
            const delta = e.deltaY;
            const zoomFactor = Math.exp(delta * 0.0015);
            zoom = Math.min(zoomMax, Math.max(zoomMin, zoom * zoomFactor));
            applyCubeRotation();
          }, { passive: false });
        } else {
          showWarning("<strong>Interactive controls unavailable.</strong> Drag surface missing.");
        }

        window.addEventListener("pointerup", endEvent => stopDragging(endEvent));
        window.addEventListener("pointercancel", endEvent => stopDragging(endEvent));

        if (!gl) {
          console.warn("[CubeViewer] WebGL unavailable; rendering CSS cube only for viewerId", viewerId);
          showWarning('<strong>WebGL unavailable.</strong> Falling back to CSS-only cube rendering (rotation and zoom still work).');
        }
      } catch (err) {
        console.error("[CubeViewer] Failed to initialize viewer", viewerId, err);
        showWarning("<strong>Interactive controls unavailable.</strong> Failed to initialize viewer script.");
      }

      const cbMin = root.getAttribute("data-cb-min");
      const cbMax = root.getAttribute("data-cb-max");
      if (cbMin !== null) {
        const minEl = document.getElementById("cb-min-" + viewerId);
        if (minEl) minEl.innerText = cbMin;
      }
      if (cbMax !== null) {
        const maxEl = document.getElementById("cb-max-" + viewerId);
        if (maxEl) maxEl.innerText = cbMax;
      }
    })();
  </script>
</body>
